import React from "react";
import PropTypes from "prop-types";

const foodILike = [
  {
    id:1,
    name:"ramen",
    image: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Shoyu_Ramen.jpg/1200px-Shoyu_Ramen.jpg",
    ratring: 5
  },
  { 
    id:2,
    name: "kimbap",
    image: "https://www.seriouseats.com/thmb/o94pqlhYlIMrT3KFLIPhs09chDo=/1500x1125/filters:fill(auto,1)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__2020__01__20200122-gimbap-vicky-wasik-24-f5ed1075f35846a29e0812ee053a1bf8.jpg"  ,
    ratring: 2
  },
  {
    id:3,
    name: "sushi",
    image: "https://rimage.gnst.jp/livejapan.com/public/article/detail/a/00/00/a0000881/img/basic/a0000881_main.jpg",

  }
];

function Food({name, image, rating}) {
  return (
    <div>
      <h1>I like {name}</h1>
      <h2>{rating}/5.0</h2>
      <img src={image} alt={name}/>
    </div>)
      ;
}

//데이터 체크
Food.propTypes = {
  name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired

}

function App() {
    return (
    <div> 
      {foodILike.map(dish => <Food key={dish.id} name={dish.name} image={dish.image} rating={dish.ratring}/>)}
    </div> 
    );
}

export default App;
